import React, { useEffect, useState } from 'react';
import Navbar from '../AdminNavbar/AdminNavbar';
import { fetchAllUsers } from '../../../api/Api.js';
import { DataGrid } from '@mui/x-data-grid';



const columns = [
    { title: 'ID', field: '_id' },
    { title: 'Full Name', field: 'fullname' },
    { title: 'UserName', field: 'username' },
    { title: 'Email', field: 'email' },
    { title: 'Mobile Number', field: 'mobilenumber' },
    { title: 'Membership', field: 'membership' },
    { title: 'Car Ids', field: 'carId' },
 
];


const AdminDashboard = () => {

    const [data, setData] = useState([]);


    const fetchallusers = async () => {
        const responce = await fetchAllUsers();
        const allUsers =  responce.data;
        setData({allUsers});
        console.log(allUsers);
    }

    useEffect(() => {
       

        fetchallusers();
    }, []);

    console.log(data);
    console.log(data);

    data.forEach(element => {
        const rowData = {
            _id: element._id,
            fullname: element.fullname,
            username: element.username,
            email: element.email,
            mobilenumber: element.mobilenumber,
            membership: element.membership,
            carId: element.carId,
        }
    }); 

    return (
        <>
            <Navbar />
            <h3>Admin Dashboard</h3>
            <div className="container">
                <DataGrid key={data._id} rows={row} columns={columns} pageSize={10} checkboxSelection />
            </div>

        </>
    )
}

export default AdminDashboard;
